// HasSeries applies the HasEdge predicate on the "series" edge.
func HasSeries() predicate.SeriesProvider {
	return predicate.SeriesProvider(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, SeriesTable, SeriesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSeriesWith applies the HasEdge predicate on the "series" edge with a given conditions (other predicates).
func HasSeriesWith(preds ...predicate.Series) predicate.SeriesProvider {
	return predicate.SeriesProvider(func(s *sql.Selector) {
		step := newSeriesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.SeriesProvider) predicate.SeriesProvider {
	return predicate.SeriesProvider(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SeriesProvider) predicate.SeriesProvider {
	return predicate.SeriesProvider(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SeriesProvider) predicate.SeriesProvider {
	return predicate.SeriesProvider(sql.NotPredicates(p))
}
